import React from 'react';

function PersonaAnalysis({ persona }) {
  return (
    <div className="persona-analysis">
      <h2>Persona Analysis</h2>
      <pre>{persona}</pre>
      <p><small>Retrieved using Tiktok API - User Object</small></p>
    </div>
  );
}

export default PersonaAnalysis;
